import React, { useEffect } from "react";
import DG from "2gis-maps";

export default function Test() {
 
  useEffect(()=>{

    let map;
    map=DG.map('map-container',{
      center:[41.271058, 69.262212],
      zoom:15
    });

    const icon = DG.icon({
      iconUrl: "https://freepngimg.com/thumb/car/75694-bird's-eye-car-top-view,plan-view-icon.png",
      iconSize:[35,30]
    });

    DG.marker([41.271058, 69.262212],{icon:icon}).addTo(map).bindPopup('open')
    
    // Set max zoom level
    // map.setMinZoom(15);
  },[])

  return (
    <div id="map-container" style={{width:'100%',height:'100vh'}}>
        
    </div>
  );
}
